import React, { Component } from "react";
import Search from "./pages/Search"
import "./App.css";
import {BrowserRouter as Router,Route} from "react-router-dom"
class App extends Component {
  render() {
    return (
      <div className="App">

    <Router>
      <Route exact path =  "/" component = {Search}></Route>
    </Router>
      </div>
    );
  }
}

export default App;
